import {Typography, makeStyles } from '@material-ui/core';
import React from 'react'

const SectionTwo = () => {
    return (
        <div style={{ border: "1px solid blue"}}> 
            <div>
                <Typography className={classes.sectionTwoHeader}>Information overload is real</Typography>
                <Typography>Do you have insights, quotes, and reminders on sticky notes, in physical and online notebooks,
                    and 101 other places...and still forget where you put that one piece of information you need right now?</Typography>
                <Typography>Wish you had a way to build upon the insights you captured in a meaningful way?</Typography>
                <Typography>Educe is setup to be your central repository for you to store your short insights and then build upon them.</Typography>
            </div>
        </div>
    )
}

export default SectionTwo
